		function validate(start, end, tempID) {
			if (((end != null && end != "") && isNaN(Date.parse(end))) || ((start != null && start != "") && isNaN(Date.parse(start)))) {
				alert('Please input valid dates.');
				return false;
				}

			if (start != null && end != null && start != "" && end != "") {
				var datesPass = Date.parse(end) >= Date.parse(start)
				if (!datesPass) {
					alert('The End Date must be after the Start Date.');
					return false;
				}
			}

			if (FieldIsEmpty($('#UploadedFiles_' + tempID + '__FileName').val())) {
					alert("Display Name cannot be blank.");
				return false;
				}

			if ($('#UploadedFiles_' + tempID + '__FileDescription').val().length > 200) {
				alert("Description cannot be longer than 200 characters");
				return false;
			}
			return true;
		}
		
