	function reloadPage(fileListLength, categoryId, fileList, fileSizes, eventHookFileContext) {
		var controlID = 'fileUploadControl';
		var uploadedFiles = [];
		for (var i = 0; i < fileList.length; i++) {
			var fileNameOnServer = fileList[i];
			var displayName = eventHookFileContext[fileNameOnServer] &&
				eventHookFileContext[fileNameOnServer]['displayName'] || fileNameOnServer;
			uploadedFiles.push({ FileName: displayName, FileNameOnServer: fileNameOnServer, FileSize : fileSizes[i] });
		}
		appendFiles(controlID, uploadedFiles);
		cancel();
	}

