			function Action(id, folderID, action, mode) {
				var validated = true;
				if (mode == 'Modify') {
					var start = $('#txtStartDate').val();
					var end = $('#txtEndDate').val();

					validated = validate(start, end);

					if (validated)
						document.aspnetForm.action = "/Admin/DocumentCenter/Document/Edit/" + id + "?folderID=" + folderID + "&saveAction=" + action + '&renderMode=' + 0 + '&loadSource=' + 0;
				}
				else if (mode == 'CopyArchived') {
					document.aspnetForm.action = "/Admin/DocumentCenter/Document/Restore/" + id + "?folderID=" + folderID + "&saveAction=" + action + '&renderMode=' + 0 + '&loadSource=' + 0;
				}
				if (validated) {
				document.aspnetForm.enctype = "multipart/form-data";
					ajaxPostBackStart();
				document.aspnetForm.submit();
			}
			}

			function validate(start, end) {
				if (((end != null && end != "") && isNaN(Date.parse(end))) || ((start != null && start != "") && isNaN(Date.parse(start)))) {
					alert('Please input valid dates.');
					return false;
				}

				if (start != null && end != null && start != "" && end != "") {
					var datesPass = Date.parse(end) >= Date.parse(start)
					if (!datesPass) {
						alert('The End Date must be after the Start Date.');
						return false;
					}
				}

				if (FieldIsEmpty($('#txtDocumentName').val())) {
					alert("Display Name cannot be blank.");
					return false;
				}

				if ($('#txtDescription').val().length > 200) {
					alert("Description cannot be longer than 200 characters");
					return false;
				}
				return true;
			}

			function checkLimit(element,limit)
			{
				var el = $('#' + element);
				if (el.val().length > limit) {
					el.val(el.val().substring(0, limit));
				}
			}
