		<script type="text/javascript">
			function enableConv(obj) {
				var ysnec;
				
				var extension = (obj.value.substr(obj.value.lastIndexOf('.') + 1)).toLowerCase();

				switch (extension) {
					case 'txt':
					case 'doc':
					case 'docx':
					case 'html':
					case 'htm':
					case 'xls':
					case 'xlsx':
					case 'gif':
					case 'jpg':
					case 'jpeg':
					case 'png':
						ysnec = true; break;
					default:
						ysnec = false;
				}
				document.getElementById("ysnConvert").disabled = !ysnec;

				if('False' == 'True' )
				{
					switch (extension) {
						case 'jpg':
						case 'jpeg':
						case 'png':
							document.getElementById("ysnCompressLess").disabled = false; 
							$('#compressLessDiv').removeClass('hidden');
							break;
						default:
							document.getElementById("ysnCompressLess").disabled = true; 
							$('#compressLessDiv').addClass('hidden');
							break;
			}
				}
			}

			$(document).ready(function () {

				var assocClientElem = document.getElementById('txtDescription');
				var counterElem = document.getElementById('charCounter');
				var fmtStandard = 'You have <em>{0}</em> character{1} left';
				var fmtOver = 'You are <em>{0}</em> character{1} over limit';
				registerCounter(assocClientElem, counterElem, fmtStandard, fmtOver, 200);

				$('.spell').click(function () {
					var spell = $find('ctl00_ctl00_ctl00_adminContent_pageContent_MainContent_spell1');
					spell.startSpellCheck();
					return false;
				});
		});
