		function Action(id, action, mode) {
			if (!$('#SaveFolder').hasClass('inactive') &&
				!$('#SavePushDownFolder').hasClass('inactive') &&
				isValidFolder()) {

				$('#SaveFolder').addClass('inactive');
				$('#SavePushDownFolder').addClass('inactive');
				$('#SavePublishFolder').addClass('inactive');
				$('#SaveSubmitFolder').addClass('inactive');

				if (action === 'SavePushDown')
					if (!confirm("WARNING: This will overwrite permissions of all subfolders, are you sure you want to continue?")) {
						$('#SaveFolder').removeClass('inactive');
						$('#SavePushDownFolder').removeClass('inactive');
						$('#SavePublishFolder').removeClass('inactive');
						$('#SaveSubmitFolder').removeClass('inactive');
						return;
					}

				if (mode == 'CopyArchived') 
					document.aspnetForm.action = "/Admin/DocumentCenter/Folder/Restore" + action + "/" + id + '?renderMode=' + 0;
				else 
					document.aspnetForm.action = "/Admin/DocumentCenter/Folder/" + action + "/" + id + '?renderMode=' + 0;

				document.aspnetForm.submit();
			}
		}

		function isValidFolder() {			
			if (document.getElementById("txtTitle").value == "") {
				alert("Name cannot be blank.");
				return false;
			} else if (document.getElementById("txtTitle").value.length > 100) {
				alert("Name cannot exceed 100 characters.");
				return false;
			}

			return true;
		}
	</script>
	
