<script type="text/javascript">
	Sys.WebForms.PageRequestManager.getInstance().add_endRequest(EndRequestHandler);
	function clearFields() {
		document.getElementById('ctl00_ctl00_adminContent_pageContent_DocumentCenterAdmin_cpModuleArchives_rbWeek').checked = true;
		document.getElementById('ctl00_ctl00_adminContent_pageContent_DocumentCenterAdmin_cpModuleArchives_txtArchivedFrom').value = '';
		document.getElementById('ctl00_ctl00_adminContent_pageContent_DocumentCenterAdmin_cpModuleArchives_txtArchivedTo').value = '';
	}
	
	var currentTextBox = null;
	var currentDatePicker = null;

	//This method is called to handle the onclick and onfocus client side events for the texbox
	function showPopup(sender, e) {
		document.getElementById('ctl00_ctl00_adminContent_pageContent_DocumentCenterAdmin_cpModuleArchives_rbDate').checked = true;
		
		//this is a reference to the texbox which raised the event
		//see the methods exposed through the $telerik static client library here - http://www.telerik.com/help/aspnet-ajax/telerik-static-client-library.html

		currentTextBox = sender.tagName == "INPUT" ? sender : $telerik.getPreviousHtmlNode(sender);

		//this gets a reference to the datepicker, which will be shown, to facilitate
		//the selection of a date
		var datePicker = $find("ctl00_ctl00_adminContent_pageContent_DocumentCenterAdmin_cpModuleArchives_rdpDatePicker");

		//this variable is used to store a reference to the date picker, which is currently
		//active
		currentDatePicker = datePicker;

		//this method first parses the date, that the user entered or selected, and then
		//sets it as a selected date to the picker
		datePicker.set_selectedDate(currentDatePicker.get_dateInput().parseDate(currentTextBox.value));

		//the code lines below show the calendar, which is used to select a date. The showPopup
		//function takes three arguments - the x and y coordinates where to show the calendar, as
		//well as its height, derived from the offsetHeight property of the textbox
		var position = datePicker.getElementPosition(currentTextBox);		
		var pageHeight = document.body.offsetHeight;

		if(($telerik.getLocation(currentTextBox).y + 196) > pageHeight) 
		{ 
			// Above 
			datePicker.showPopup(position.x, position.y - 196);
		} 
		else 
		{
			// Below 
			datePicker.showPopup(position.x, position.y + currentTextBox.offsetHeight);
		} 
	}
	
	function hideDatePicker() {
		var datePicker = $find("ctl00_ctl00_adminContent_pageContent_DocumentCenterAdmin_cpModuleArchives_rdpDatePicker");		
		datePicker.hidePopup();
	}
	
	//this handler is used to set the text of the TextBox to the value of selected from the popup
	function dateSelected(sender, args) {
		if (currentTextBox != null) {
			//currentTextBox is the currently selected TextBox. Its value is set to the newly selected
			//value of the picker
			currentTextBox.value = args.get_newValue();
		}
	}

	//this function is used to parse the date entered or selected by the user
	function parseDate(sender, e) {
		if (currentDatePicker != null) {
			var date = currentDatePicker.get_dateInput().parseDate(sender.value);
			var dateInput = currentDatePicker.get_dateInput();

			if (date == null) {
				date = currentDatePicker.get_selectedDate();
			}

			var formattedDate = dateInput.get_dateFormatInfo().FormatDate(date, dateInput.get_displayDateFormat());
			sender.value = formattedDate;
		}
	}

	function applyFilterEnter(ev){
		ev = (window.event ? window.event : ev);
		if(ev.keyCode==13)
			applyFilter();
	}

	function applyFilter(uniqueID) {
		var frmAF = document.aspnetForm;
		if(document.getElementById('ctl00_ctl00_adminContent_pageContent_DocumentCenterAdmin_cpModuleArchives_rbDate').checked)
		{
			var startDate = document.getElementById('ctl00_ctl00_adminContent_pageContent_DocumentCenterAdmin_cpModuleArchives_txtArchivedFrom');
			var endDate = document.getElementById('ctl00_ctl00_adminContent_pageContent_DocumentCenterAdmin_cpModuleArchives_txtArchivedTo');
			if(startDate)
			{
				var objDate = new dateValidator();
				objDate.setStartDate(startDate.value);
				objDate.setEndDate(endDate.value);
				objDate.ysnAllowEqualDates = true;
				if (!objDate.dateOrderValidate()) {
					if (objDate.error) alert(objDate.error);
					else alert("unknown error");
					return false;
				}
			}
		}
		asyncPostBack('1', 'Archive', uniqueID);
	}
		
	function asyncPostBack(eventArg, strPage, uniqueID){
		var frmAF = document.aspnetForm;
		frmAF.strPage.value = strPage;
		frmAF.intArchMainCatID.value = -1;
		frmAF.intArchMainItemID.value = -1;
		if(uniqueID)
			__doPostBack(uniqueID, eventArg);
		else
			__doPostBack('ctl00$ctl00$adminContent$pageContent$DocumentCenterAdmin$cpModuleArchives$lnkApply', eventArg);
	}

	function EndRequestHandler(sender, args)
	{
		var hasPubliclyVisibleEnabledItems = !$('#cboxPub').prop('disabled');
		var hasPubliclyHiddenEnabledItems = !$('#cboxUnPub').prop('disabled');
		
		if (hasPubliclyVisibleEnabledItems) {
			$('#btnBulkActionHide').removeClass('inactive');
			$('#btnBulkActionHide').unbind('click').bind('click', function () {
				if (useBulkActions(0)) {
					BulkActionProcessDuo(document.aspnetForm, 'ArchiveHideAll', 1);
				}
			});
		}
		else {
			$('#btnBulkActionHide').addClass('inactive');
			$('#btnBulkActionHide').unbind('click');
		}
		
		if (hasPubliclyHiddenEnabledItems) {
			$('#btnBulkActionShow').removeClass('inactive');
			$('#btnBulkActionShow').unbind('click').bind('click', function () {
				if (useBulkActions(0)) {
					BulkActionProcessDuo(document.aspnetForm, 'ArchiveShowAll', 1);
				}
			});
		}
		else {
			$('#btnBulkActionShow').addClass('inactive');
			$('#btnBulkActionShow').unbind('click');
		}	
	}

	window.onload = function () {
		document.onclick = function () {
			$('.popUp').fadeOut(200).removeClass('popped');
			$('.popUpParent').removeClass('popped');
		};
	};
